import { useState } from "react";
import { Form } from "react-router-dom";
import axios from 'axios';

const Auth = () => {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    const login = async () => {
        try {
            const response = await axios.post("http://localhost:3002/users/login", {email, password});
            const token = response.data.token;
            console.log(response.data);
            localStorage.setItem('token', token);
            console.log("done");
        } catch(error) {
            console.log(error);
        }
    };

    return <>
        <Form method="post">
        <p>
            <label htmlFor="email">Email</label>
            <input id="email" type="email" name="email" onChange={(e) => setEmail(e.target.value)} required/>
        </p>
        <p>
            <label htmlFor="password">Password</label>
            <input id="password" type="password" name="password" onChange={(e) => setPassword(e.target.value)} required/>
        </p>
        <div>
            <button onClick={login}>Login</button>
        </div>
        </Form>
    </>;
};

export default Auth;
